import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const App = () => {
  const now = new Date();
  const a = 10;
  const b = 20;
  const logger = (x)=>{x.toString()};

  return (
    <div>
      <p>Hello world, it is {now.toString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p> 
      <p>
        {logger(now)}
      </p>    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
